import {Navigate} from "react-router-dom";
import DashboardEditions__chief from "./chief/DashboardEditions__chief";
import {getUserData, validUser} from "../api/handleLogin";
import React, {useState} from "react";
import Login from "./Login";
import {getRedirectStatus, isAdmin} from "../helpers/redirection";

export function Dashboard() {

    const [redirect, setRedirect] = useState(false);
    getRedirectStatus(true)
        .then(resp => {
            setRedirect(resp)
            console.log("STATUS")
        })

    const [admin, setAdmin] = useState(null);
    isAdmin()
        .then(resp => {
            setAdmin(resp)
            console.log("RANK")
        })

    return(
        <>
            {redirect && <Navigate to={"/"}/>}
            {admin == true && <h1>Admin</h1>}
            {admin == false && <h1>Not Admin</h1>}
        </>
    )

}
